% This file is used to QA/QC Granier sapflow data. Input file is "PJ
% control.xls".  Output files are PJ_control_dTmax, PJ_control_Js.

% PJ Control has 5 PIED, 5 JUMO


%clc; clear; %he pasado de esto y no lo he cargado, ver si luego sale

plotdata = dlmread('Input_PJg_continuo_todo_csv.csv',',',1,1);% AQUI PASA DE LA PRIMERA COLUMNA Y DE LA PRIMERA LINEA

ts_cols = plotdata(:,1:3);%esto simplemente identifica los datos temporales[todas las filas (:), columnas de la 1 a la 3 (1:3)]
run make_Litvak_timestamp; % generates 11-column "lts" en base a ts_col este programa crea 11 columnas temporales
%TENGO UN PROBLEMA CON Litvak_timestamp QUE ME GENERA FALOS EL DIA 1 DE
%ENERO DE CADA AÑO!!!,LO CAMBIO MANUALMENTE POR EL MOMENTO.

% Subset the Granier data
ltsdata = [lts(:,:) plotdata(:,76:105)]; %clear lts; %esto coje los datos unicamente de sapflow (ahora 76:95 con nuevo archivo), y crea un nuevo archivo, ltsdata, CON LAS lts COLUMNAS que cró make_Litvak_timestamp Y LOS DATOS DE FLUJO DE ESAS FECHAS que estaban en plotdata 
save('ltsdata','ltsdata');
save('lts','lts');
dlmwrite('ltsdata_girdled.csv',ltsdata, 'delimiter', ',', 'precision', '%.6f');
dlmwrite('lts.csv',lts, 'delimiter', ',', 'precision', '%.6f');
%Si parto de los archivos 2008 y 2009 y no quiero volver a cambiar los
%errores del 1 de enero:
ltsdata = dlmread('ltsdata.csv',',');
lts= dlmread('lts.csv',',');
G_raw = ltsdata;


%To work directly with the database with right timestamp (this is the one I finally used):
plotdata = dlmread('Input_PJg_continuo_todo_timecol.csv',',',1,1);% AQUI PASA DE LA PRIMERA COLUMNA Y DE LA PRIMERA LINEA
lts=  plotdata(:,1:11);
ltsdata = [lts(:,:) plotdata(:,84:113)]; %clear lts; %esto coje los datos unicamente de sapflow (ahora 76:95 con nuevo archivo), y crea un nuevo archivo, ltsdata, CON LAS lts COLUMNAS que cró make_Litvak_timestamp Y LOS DATOS DE FLUJO DE ESAS FECHAS que estaban en plotdata 

G_raw = ltsdata;


% Generate means and standard errors for raw mV data
Pmean_raw = nanmean(G_raw(:,12:21),2); % mean PIED mV (promedia todas las medidas de la columna 12 a la 21 ue corresponde a las dos mediciones por pino)
cols = G_raw(:,12:21)';
Pn_raw = size(G_raw(:,12:21),2)-sum(isnan(cols(:,:)))'; % PIED n
colstd = nanstd(cols);
Pste_raw = colstd' ./ sqrt(Pn_raw); % PIED mV standard error (esta y las 2 filas anteriores es para que no use los valores NaN en el calculo de la desviacion standard)
clear cols;
clear colstd;
% This is to create un dato promedio de todos los juniperus y todos los
% sensores:
Jmean_raw = nanmean(G_raw(:,22:31),2); % mean JUMO mV
cols = G_raw(:,22:31)';
Jn_raw = size(G_raw(:,22:31),2)-sum(isnan(cols(:,:)))'; % JUMO n
colstd = nanstd(cols);
Jste_raw = colstd' ./ sqrt(Jn_raw); % JUMO mV standard error
clear cols;
clear colstd;
% Generate means and standard errors for small pinus (SP):
SPmean_raw = nanmean(G_raw(:,32:41),2); % mean PIED mV (promedia todas las medidas de la columna 12 a la 21 ue corresponde a las dos mediciones por pino)
cols = G_raw(:,32:41)';
SPn_raw = size(G_raw(:,32:41),2)-sum(isnan(cols(:,:)))'; % PIED n
colstd = nanstd(cols);
SPste_raw = colstd' ./ sqrt(SPn_raw); % PIED mV standard error (esta y las 2 filas anteriores es para que no use los valores NaN en el calculo de la desviacion standard)
clear cols;
clear colstd;
% Make the matrix of data that will be changed (para crear una matriz de
% datos limpios)
G_clean = G_raw;

% Broad-stroke screening for high/low mV.  Previously we have used 0.15 to
% 0.5 mV as "good" data but there appear to be some plausible points below
% 0.15 so this maybe should be tweaked. Esto es para quitar los datos que
% claramente son erroneos segun unas boundaries or thresholds
y = G_raw(:, 12:41); % subset sapflow columns
z = find(y >=0.7 | y <= 0.05); % ID high and low mV values ESTOS SON LOS THRESHOLDS max=0.6, min=0.05
y(z) = NaN;  %make those ones NaNs
G_clean(:, 12:41) = y; %replace values in original matrix

